/* DOMAIN VARIABLE LIST INITIALIZATION */
static ST_VOID mvl_init_dom_varLists ()
  {
MVL_DOM_CTRL *dom;
MVL_NVLIST_CTRL *vl;
MVL_NVLIST_CTRL **ppvl;

  dom = mvl_vmd.dom_tbl [0];	/* allocated by mvl_init_dom_vars	*/

/* Domain: 'LD0'	*/

  dom->max_num_nvlist = 0 + mvl_max_dyn.dom_nvls;
  dom->num_nvlist = 0;
  if (dom->max_num_nvlist)
    dom->nvlist_tbl = ppvl = (MVL_NVLIST_CTRL **) M_CALLOC (MSMEM_STARTUP, dom->max_num_nvlist, sizeof (MVL_NVLIST_CTRL *));
  ++dom;

/* Domain: 'LN0'	*/

  dom->max_num_nvlist = 0 + mvl_max_dyn.dom_nvls;
  dom->num_nvlist = 0;
  if (dom->max_num_nvlist)
    dom->nvlist_tbl = ppvl = (MVL_NVLIST_CTRL **) M_CALLOC (MSMEM_STARTUP, dom->max_num_nvlist, sizeof (MVL_NVLIST_CTRL *));
  ++dom;

/* Domain: 'pbroDev'	*/

  dom->max_num_nvlist = 1 + mvl_max_dyn.dom_nvls;
  dom->num_nvlist = 1;
  if (dom->max_num_nvlist)
    dom->nvlist_tbl = ppvl = (MVL_NVLIST_CTRL **) M_CALLOC (MSMEM_STARTUP, dom->max_num_nvlist, sizeof (MVL_NVLIST_CTRL *));
  vl = (MVL_NVLIST_CTRL *) M_CALLOC (MSMEM_STARTUP, 1, sizeof (MVL_NVLIST_CTRL));
  vl->name = "varList";
  vl->num_of_entries = 2;
  vl->entries = (MVL_VAR_ASSOC **) M_CALLOC (MSMEM_STARTUP, 2, sizeof (MVL_VAR_ASSOC *));
  vl->va_scope = (MVL_SCOPE *) M_CALLOC (MSMEM_STARTUP, 2, sizeof (MVL_SCOPE));
  vl->nvl_scope.scope = DOM_SPEC;
  vl->nvl_scope.dom = dom;
  {
  OBJECT_NAME varObjName;
  varObjName.obj_name.vmd_spec = "DI$Name";
  varObjName.object_tag = DOM_SPEC;
  varObjName.domain_id = mvl_vmd.dom_tbl[2]->name;
  vl->entries [0] = u_mvl_get_va_aa (&mvl_vmd, MMSOP_INFO_RPT, &varObjName, NULL, SD_FALSE, NULL, NULL);
  assert (vl->entries[0]!=NULL);
  }
  vl->va_scope[0].scope = DOM_SPEC;
  vl->va_scope[0].dom = mvl_vmd.dom_tbl[2];
  {
  OBJECT_NAME varObjName;
  varObjName.obj_name.vmd_spec = "DI$Class";
  varObjName.object_tag = DOM_SPEC;
  varObjName.domain_id = mvl_vmd.dom_tbl[2]->name;
  vl->entries [1] = u_mvl_get_va_aa (&mvl_vmd, MMSOP_INFO_RPT, &varObjName, NULL, SD_FALSE, NULL, NULL);
  assert (vl->entries[1]!=NULL);
  }
  vl->va_scope[1].scope = DOM_SPEC;
  vl->va_scope[1].dom = mvl_vmd.dom_tbl[2];
  *ppvl++ = vl++;
  ++dom;

/* Domain: 'timeTest'	*/

  dom->max_num_nvlist = 0 + mvl_max_dyn.dom_nvls;
  dom->num_nvlist = 0;
  if (dom->max_num_nvlist)
    dom->nvlist_tbl = ppvl = (MVL_NVLIST_CTRL **) M_CALLOC (MSMEM_STARTUP, dom->max_num_nvlist, sizeof (MVL_NVLIST_CTRL *));
  ++dom;
  }

